import React from 'react';
import FlashCard from '../FlashCard/FlashCard';

const CardList = ({ flashcards }) => {
	return (
		<div className="card-grid">
			{flashcards.map((card) => {
				return <FlashCard flashcard={card} key={card.id} />
			})}
		</div>
	);
}

export default CardList;
